import { Nav, NavItem, NavLink } from 'reactstrap';

const Header = (props) => (
   <Nav>
      {
         props.navitems.forEach(navitem => {
            return (
               <NavItem>
                  <NavLink href={navitem.link}>{navitem.label}</NavLink>
               </NavItem>
            )
         })
      }
   </Nav>
)

export default Header
